import React, { Component } from 'react'

export default class Demo extends Component {
    nome() {
        const nome = "Carlos eduardo"
        return nome;
    }
    render() {
        return (
            <div>
                <h1>{this.nome()}</h1>
                <h2>Hello World!! Reactjs</h2>
            </div>
        )
    }
}
